import styles from "./ToggleButton.scss";



const ToggleButton = ({title}) => {

    const onClick = () => {
        style.backgroundColor = "blue";
    }
    return (
        <button className={styles.toggleButton} onClick={onClick}>{title}</button>
    )
}

export default ToggleButton;
